window.bookSummaryJSON = "<p>While concluding a European vacation with his girlfriend, Kathleen, Jake Travis is given an assignment: Kill an international assassin who targets the loved ones of special ops personnel. The assassin is known to dress as a cardinal and take contemplative strolls in Kensington Gardens. Jake completes his task and he and Kathleen return to Florida where she learns that he \"clipped the wrong bird\". Jake had murdered a popular and progressive cardinal. </p> <p>Jake must now track down a woman who can lead him to the real killer before he strikes again. Kathleen recoils from their relationship upon Jake's confession of his fateful act, leaving him to agonize whether or not he's lost her for good. Meanwhile, Jake is obsessed with his struggle to answer the central question he desperately needs to resolve: Why did the cardinal use Jake to end his life? </p>"; 
